import React, { useState, useEffect } from 'react';
import WebSocket from 'ws';

function App() {
  const [items, setItems] = useState("TEST DE LOUIS test");

  useEffect(() => {
    const ws = new WebSocket('ws://localhost:5000');

    ws.onmessage = event => {
      setItems(JSON.parse(event.data));
    };

    return () => {
      ws.close();
    };
  }, []);

  return (
    <div>
      <h1>Items from Backend</h1>
      <p>{items}</p>
    </div>
  );
}

export default App;
